import {Button, StyleSheet, Text, View} from "react-native";
import AsyncStorage from "@react-native-async-storage/async-storage";
import {useEffect, useState} from "react";
import axios from "axios";

async function getSessionId(){
    return await AsyncStorage.getItem("sessionId");
}

const FriendsScreen = ({navigation}) =>{

    const [data, setData] = useState([]);
    const [sessionId, setSessionId] = useState("");

    useEffect(() =>{
        async function setting(){
            return await getSessionId();
        }
        const promise = setting();

        promise.then(async (value) =>
            {
               try{
                   const result= await axios.get(`http://localhost:8080/members/${value}/friends`,
                       {
                           headers:{
                               'Content-Type': 'application/json'
                           }
                       }
                   );
                   setData(result.data);
               }catch(e){
                   console.log("axios error : " + e);
               }

            }
        );


        // axios.get(`http://localhost:8080/members/${sessionId}`)
    },[])
    return (
        <View style={styles.container}>
            <Text>
                Friends Screen!!
            </Text>
            <Button title="sessionId" onPress={getSessionId}/>
        </View>
    )
}

const styles = StyleSheet.create({
    container:{
        alignItems:"center",
        justifyContent : "center"
    }
})

export default FriendsScreen
